import Vue from 'vue'
import Router from 'vue-router'
import Index from "Index.vue";
import Detail from "Detail.vue";
import New from "New.vue";
import Edit from "Edit.vue";

Vue.use(Router)

const router = new Router({
    routes: [
        {
            path: '/',
            name: 'Index',
            component: Index,
            meta: {
                isPublic: true
            }
        },
        {
            path: '/menu/:id(\\d+)',
            name: 'Detail',
            component: Detail,
            meta: {
                isPublic: true
            }
        },
        {
            path: '/menu/new',
            name: 'New',
            component: New,
            meta: {
                isPublic: true
            }
        },

        {
            path: '/menu/:id(\\d+)/edit',
            name: 'Edit',
            component: Edit,
            meta: {
                isPublic: true
            }
        }
    ]
})

export default router
